    align-items: center;
    padding-top:10rem;

`

const Grid = styled.div`
    display:grid;
    grid-template-columns:repeat(2,minmax(calc(10rem+ 15vh)));
`

function MyExperiencePage() {
    const [click,setClick ]= useState(true)
    return (
        <MainContainer>
            <Container>
                <LogoComponent/>
                <Socialicons/>
                <Center>
                    <Grid></Grid>
                </Center>
            </Container>
        </MainContainer>
    );
}

export default MyExperiencePage
